import React from "react";
import Image from "next/image";
import { Wrap } from "../styles/Cover";

function About() {
  return (
    <Wrap>
      <Image
        src="/cover-02.jpg"
        width={350}
        height={190}
        layout={"responsive"}
        className="cover-image"
      />

    </Wrap>
  );
}

export default About;
